        this.set(this.dashboardPageInfoContentLanguageItemName, { language: `fi`, value: `Tervetuloa Renta Toolsiin!<br/><br/>Tm on Renta Toolsin etusivu. Tlt voit etsi laitteita kirjoittamalla Renta-numeron tekstikenttn ja valitsemalla "Tunnista laite".<br/><br/>Valikon avulla voit mys avata erilaisia sivuja, kuten palautustarkastusluettelon, huolto- ja korjausluettelon, vuositarkastusluettelon tai tankkaus- ja puhdistusluettelon.<br/><br/>Oikeasta ylkulmasta voit avata nm ohjeet, kytt valikkopainikkeesta koko pvalikkoa (mukaan lukien tiliasetukset, usein kysytyt kysymykset, tuki ja uloskirjautuminen) sek muuttaa Renta Toolsin nyttkielt.<br/><br/>Pset aina etusivulle painamalla vasemmassa ylkulmassa olevaa Renta Tools -logoa.<br/><br/>Vasemman ylkulman nuolipainikkeesta pset yhden sivun taaksepin, mutta voi kytt mys selaimen Takaisin-painiketta.` }, { language: `sv`, value: `Vlkommen till Renta Tools!<br/><br/>Detta r frstasidan i Renta Tools. Hr kan du ska efter enheter genom att skriva Renta ID i textfltet och vlja "Hitta enhet".<br/><br/>Du kan ocks anvnda menyn fr att ppna olika sidor som retur, service- och reparationslista, rliga besiktningslista eller tanknings- och stdlista.<br/><br/>Uppe till hger kan du ppna dessa instruktioner, komma t hela menyn, inklusive kontoinstllningar, support och utloggning, och ndra skrmsprket fr Renta Tools.<br/><br/>Du kommer alltid till framsidan genom att trycka p Renta Tools logotyp i det vre vnstra hrnet.` }, { language: `pl`, value: `Witamy w Renta Tools!<br/><br/>Oto strona gwna Renta Tools. Moesz tutaj wyszuka urzdzenia po jego kodzie wybierajc opcj "Znajd urzdzenie".\n\nMoesz take posuy si gwnym menu, by dosta si do rnych stron, tj.: listy kontroli powrotnych, listy napraw i przegldw, czy listy tankowania oraz mycia.\n\nW prawym grnym rogu moesz otworzy instrukcje, uzyska dostp do penego menu, w tym take ustawie konta, pomocy technicznej i wylogowania, a take zmieni jzyk wywietlania Renta Tools.\n\nMoesz zawsze powrci do strony gwnej aplikacji naciskajc w lewym grnym rogu logo Renta Tools.` }, { language: `nb`, value: `Velkommen til Renta Tools!<br/><br/>Dette er forsiden til Renta Tools. Her kan du ske etter enheter ved  skrive inn Renta ID i tekstfeltet og velge "Finn enhet".\n\nDu kan ogs bruke menyen til  pne forskjellige sider som returinspeksjoner, service- og reparasjonsliste, rlige inspeksjoner eller drivstoff- og rengjringsliste.\n\nFra verst til hyre kan du pne disse instruksjonene, f tilgang til hele menyen, inkludert kontoinnstillinger, support og utlogging, og endre skjermsprket til Renta Tools.\n\nDu kommer alltid til forsiden ved  trykke p Renta Tools-logoen i vre venstre hjrne.` }, { language: `en`, value: `Welcome to Renta Tools!<br/><br/>This is the front page of Renta Tools. In here you can search for devices by typing the Renta ID to the  text field and selecting Find device.\n\nYou can also use the menu to open different pages like return inspections list, services and repairs list, annual inspections list or fueling and cleaning list.\n\nFrom the top right you can open these instructions, access the full menu, including also account settings, support and logging out, and change the screen language of Renta Tools.\n\nYou can always access the front page by pressing the Renta Tools logo in the upper left corner.` }, { language: `da`, value: `Velkommen til Renta Tools!<br/><br/>Dette er forsiden af Renta Tools. Her kan du sge efter individer ved at skrive Renta ID'et i tekstfeltet og vlge "Find enhed". \n\nDu kan ogs bruge menuen til at bne forskellige sider som inspektionsliste, service og reparationer liste, rlige inspektionsliste eller brndstof- og rengringsliste. \n\nFra verste hjre hjrne kan du bne disse instruktioner, f adgang til den fulde menu, ogs kontoinstillinger, support og logge ud, og ndre skrmens sprog i Renta Tools. \n\nDu kan altid f adgang til forsiden ved at trykke p Renta Tools-logoet i verste venstre hjrne.` },);
        this.set(this.annualInspectionsPageInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Vuosittaisten tarkastusten luettelo` }, { language: `sv`, value: `Sidanvisningar: rlig besiktningslista` }, { language: `pl`, value: `Instrukcje do strony: Lista rocznych przegldw` }, { language: `nb`, value: `Sideveiledning: rskontroll liste` }, { language: `en`, value: `Page instructions: Annual inspections list` }, { language: `da`, value: `Vejledning : rlig inspektions liste` },);
