        this.set(this.annualInspectionsPageInfoContentLanguageItemName, { language: `fi`, value: `Tll sivulla nkyvt jokaisen toimipisteen kaikki vuositarkastukset, mukaan lukien tulevat ja myhiset vuositarkastukset, menneet vuositarkastukset sek suoritetut vuositarkastukset, jotka odottavat viel huomautusten korjaamista.\n\nVoit kytt vlilehti Tulevat, Huomautukset ja Menneet valitaksesi, mit vuositarkastusluetteloa haluat tarkastella.\n\nOranssin suodatinkuvakkeen avulla voit rajata luettelossa nkyvi kohteita. Voit esimerkiksi tarkastella vain yhden tuoteryhmn kaikkia laitteita.\n\nItse tarkastuslistasta lydt laitteen nimen, vuokraustunnuksen, tuoteryhmn, varastonumeron, laitteen tilan, edellisen tarkastuksen pivmrn ja seuraavan tarkastuksen erpivn.\n\nKaikki laitteet on vrikoodattu niiden tilan mukaan:\n\n<b>Valkoinen, ilman pivmri</b>\n\nVuosittaista tarkastustietoa ei ole saatavilla. Tmn laitteen tarkastustietueissa ei ole merkintj. Tarkista nm laitteet ja syt tarvittavat tiedot Renta Toolsiin.\n\n<b>Valkoinen, pivmrill</b>\n\nVuositarkastus on suoritettava yli kuukauden kuluttua.\n\n<b>Sininen</b>\n\nNill laitteilla on kuukausi aikaa vuositarkastukseen.\n\n<b>Keltainen</b>\n\nNill laitteilla on kaksi viikkoa aikaa vuositarkastukseen.\n\n<b>Punainen</b>\n\nVuositarkastus myhss! Seuraavan vuositarkastuksen erpiv on ylitetty.` }, { language: `sv`, value: `Denna sida visar alla rliga besiktningar fr varje dep inklusive: kommande och sena rliga besiktningar, tidigare rliga besiktningar samt genomfrda rliga besiktningar som fortfarande vntar p att anmrkningar ska korrigeras.\n\nDu kan anvnda flikarna Kommande, Anmrkningar och Dtid fr att vlja vilken rsbesiktningslista du vill se.\n\nMed den orangea filterikonen kan du begrnsa objekten som visas p listan. Du kan till exempel bara se alla enheter frn en produktgrupp.\n\nI sjlva besiktningslistan kan du hitta enhetstnamn, Renta ID, produktgrupp, dep, enhetens status, fregende besiktningsdatum och nsta besiktnings frfallodatum.\n\nAlla enheter r frgkodade:\n\n<b>Vit, utan datum</b>\n\nInga rliga inspektionsdata finns tillgngliga. Det finns inga poster i enhetens inspektionsregister. Du br kontrollera dessa enheter och mata in ndvndig data till Renta Tools.\n\n<b>Vit, med datum</b>\n\nDen rliga besiktningen ska ske om mer n en mnad.\n\n<b>Bl</b>\n\nDessa enheter har en mnad kvar tills den rliga inspektionen ska genomfras.\n\n<b>Gul</b>\n\nDessa enheter har tv veckor kvar tills den rliga inspektionen ska genomfras.\n\n<b>Rd</b>\n\nDen rliga besiktningen r sen! Frfallodagen fr nsta rliga besiktning har verskridits.` }, { language: `pl`, value: `Ta strona pokazuje wszystkie przegldy roczne z kadego oddziau, wczajc w to: nadchodzce oraz zalege, minione oraz zakoczone przegldy, ktre czekaj na komentarz.\n\nBy wybra, ktry przegld chcesz zobaczy, posu si zakadkami Nadchodzce, Uwagi, Minione.\n\nUywajc pomaraczowej ikony filtra mona zawzi liczb maszyn pojawiajcych si na licie. Dla przykadu, mona wywietli maszyny przynalene jedynie do jednej grupy.\n\nNa licie przegldw mona zobaczy nazw urzdzenia, jego kod, grup produktow, kod oddziau, status maszyny, dat poprzedniego oraz nastpnego przegldu.\n\nWszystkie maszyny oznaczone s kolorem, w zalenoci od statusu:\n\n<b>Biay, bez dat</b>\n\nData rocznego przegldu jest niedostpna. Nie ma adnych zapisw zwizanych z tym przegldem. Maszyny te powinny zosta sprawdzone, a daty, jeli istnieje konieczno, uzupenione.\n\n<b>Biay, z datami</b>\n\nTermin przegldu rocznego przypada za ponad miesic.\n\n<b>Niebieski</b>\n\nTermin przegldu rocznego przypada za mniej ni miesic.\n\n<b>ty</b>\n\nTermin przegldu rocznego przypada za mniej ni dwa tygodnie.\n\n<b>Czerwony</b>\n\nTermin przegldu rocznego upyn!` }, { language: `nb`, value: `Denne siden viser alle rskontroller for hvert depot inkludert: kommende og for sene rskontroller, tidligere rskontroller samt gjennomfrte rskontroller som fortsatt venter p at anmerkninger skal rettes.\n\nDu kan bruke fanene Kommende, Merknader og Tidligere for  velge hvilken rskontroll-liste du nsker  se.\n\nVed  bruke det oransje filterikonet kan du begrense elementene som vises p listen. For eksempel kan du bare se alle enheter fra n produktgruppe.\n\nI selve rskontroll-listen kan du finne enhetsnavn, Renta ID, produktgruppe, depotnummer, enhetsstatistikk til forrige inspeksjonsdato og neste inspeksjons forfallsdato.\n\nAlle enheter er fargekodet etter status:\n\n<b>Hvit, uten datoer</b>\n\nIngen rskontroll data er tilgjengelige. Det er ingen oppfringer i denne enhetens inspeksjonsposter. Du br sjekke disse enhetene og legge inn de ndvendige dataene til Renta Tools.\n\n<b>Hvit, med datoer</b>\n\nrskontroll skal utfres mer enn en mned fra n.\n\n<b>Bl</b>\n\nDisse enhetene har en mned igjen til rskontroll skal utfres.\n\n<b>Gul</b>\n\nDisse enhetene har to uker igjen til rskontroll skal utfres.\n\n<b>Rd</b>\n\nrskontroll er forsinket! Frist for neste rlige kontroll er overskredet.` }, { language: `en`, value: `This page shows all annual inspections for each depot including: upcoming and late annual inspections, past annual inspections as well as completed annual inscpetions which are still waiting for remarks to be corrected.\n\nYou can use the tabs Upcoming, Remarks and Past to select which annual inspection list you want to view.\n\nUsing the orange filter icon, you can narrow down the items appearing on the list. For example, you can only view all devices from one product group.\n\nIn the inspection list itself you can find device name, Renta ID, product group, depot number, device statsu previous inspections date and next inspections due date.\n\nAll devices are colour coded by their status:\n\n<b>White, without dates</b>\n\nNo annual inspection data is available. There are no entries in this devices inspection records. You should check these devices and input the necessary data to Renta Tools.\n\n<b>White, with dates</b>\n\nAnnual inspection is due more than one month from now.\n\n<b>Blue</b>\n\nThese devices have one month left until annual inspection is due.\n\n<b>Yellow</b>\n\nThese devices have two weeks left until annual inspection is due.\n\n<b>Red</b>\n\nAnnual inspection is late! The due date for the next annual inspection has been exceeded.` }, { language: `da`, value: `Denne side viser alle rlige inspektioner for hver afdeling, herunder: kommende og forsinket rlige inspektioner, tidligere rlige inspektioner samt afsluttede rlige inspektioner, som stadig venter p rettelser.\n\nDu kan bruge fanerne Kommende, Bemrkninger og Tidligere til at vlge, hvilken rlig inspektionsliste du vil se.\n\nVed hjlp af det orange filterikon kan du indsnvre de elementer, der vises p listen. Du kan f.eks. kun se alle enheder fra n produktgruppe.\n\nI selve inspektionslisten kan du finde Individsnavn, individ ID, produktgruppe, afdelingsnummer, enhedsstatistik for tidligere inspektionsdato og nste inspektions forfaldsdato.\n\nAlle enheder er farvekodede efter deres status:\n\n<b>Hvid, uden datoer</b>\n\nDer foreligger ingen rlige inspektionsdata. Der er ingen poster i dette individs inspektionsoptegnelser. Du br kontrollere disse individer og indtaste de ndvendige data til Renta Tools.\n\n<b>Hvid, med dadler</b>\n\nrligt eftersyn skal ske om mere end en mned.\n\n<b>bl</b>\n\nDisse individer har en mned tilbage, indtil den rlige inspektion forfalder.\n\n<b>gul</b>\n\nDisse individer har to uger tilbage, indtil den rlige inspektion forfalder.\n\n<b>rd</b>\n\nrlig inspektion er sent! Forfaldsdatoen for den nste rlige inspektion er overskredet.` },);
        this.set(this.servicedDevicesInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Huollot & korjaukset lista` }, { language: `sv`, value: `Sidinstruktioner: Lista ver service och reparationer` }, { language: `pl`, value: `Instrukcja strony: Lista napraw i serwisw` }, { language: `nb`, value: `Sideinstruksjoner: Liste over servicer og reparasjoner` }, { language: `en`, value: `Page instructions: Services & repairs list` }, { language: `da`, value: `Page instructions: Services & repairs list` },);
        this.set(this.servicedDevicesInfoContentLanguageItemName, { language: `fi`, value: `Tll sivulla net kunkin toimipisteen kaikki odottavat ja skettin suoritetut huollot ja/tai korjaukset.\n\nJokainen listan kohde nytt seuraavat tiedot:\n\n- Renta-numero\n\n- Toimipisteen numero\n\n- Laitteen nimi\n\n- Pivmr, milloin laite on asetettu huoltoon tai korjattavaksi\n\n- Tuoteryhmn nimi\n\n- Huollon tai korjauksen tila\n\n- Lyhyt kuvaus\n\nListan ulkoasun kokoa voi muuttaa klikkaamalla ikonia, jossa on kolme valkoista viivaa pllekkin.\n\nHuolto- ja korjauslista on mys vrikoodattu:\n\n\n<b>Oranssi</b> - Odottaa huoltoa tai korjausta\n\n\n<b>Vihre</b> - Huolto tai korjaus kynniss\n\n\n<b>Sininen</b> - Valmis huolto tai korjaus \n\n      \n\nKyttmll sininst suodatusikonia voit rajata listalla nytettvien kohteiden mr. Voit esimerkiksi suodattaa laitteet yhdest tietyst tuoteryhmst. Oletusarvona net laitteet, jotka odottavat huoltoa tai korjausta sek laitteet joiden huolto tai korjaus on kynniss. Jos haluat tarkastella valmistuneita huoltoja tai korjauksia, valitse Huollon tilanne valikosta vaihtoehto Valmis.\n\nOletuksena voit tarkastella vain oman toimipisteesi laitteita, mutta jos sinulla on oikeus tarkastella muiden toimipisteiden laitteita, saatat nhd listassa useamman kuin yhden varastonumeron.\n\nListan rivi painamalla pset tarkastelemaan kyseisen laitteen omaa sivua.` }, { language: `sv`, value: `Den hr sidan visar pgende och nyligen genomfrd service och/eller reparationer p depn.\n      \n\nVarje listobjekt visar fljande information:\n      \n\n- Renta nummer\n\n- Dep\n\n- Mrke/modell\n\n- Datum d enheten sattes i service / reparation\n\n- Benmning\n\n- Status fr service/reparation\n      \n\n- Kommentar\n      \n\nIntervall fr de listobjekt som du kan hantera med hjlp av ikonen med tre vita horisontlinjer. \n\nS&R-listan har ocks en frgkod:\n\n<b>orange</b> - vntar p service/reparation\n\n<b>grn</b> - Pgende service / reparation\n\n<b>bl</b> - Slutfrd\n\nMed hjlp av den bl filterikonen kan du begrnsa de objekt som visas i listan. Du kan till exempel visa alla enheter frn en produktgrupp. Som standard kan du bara se enheter som vntar p service/reparation eller pgende. Om du vill se "Slutfrda" kan du vlja "Avslutad" i fltet Servicestatus.\n      \n\nSom standard kan du bara se din egen deps enheter, men om du har behrighet att se andra depers enheter kan du se mer n en dep i listan.\n      \n\nGenom att klicka p ett objekt i listan kan du visa sidan fr enheten i frga.` }, { language: `pl`, value: `Ta strona pokazuje wszystkie trwajce lub ostatnio zakoczone serwisy i naprawy dla kadego oddziau.\n\nKady element na licie wskazuje informacje:\n\n- Kod Renta\n\n- Numer oddziau\n\n- Nazwa urzdzenia\n\n- Data, kiedy urzdzenie znalazo si na licie\n\nPoprzez kliknicie w urzdzenie na licie, mona dosta si do strony urzdzenia. \n\nUywajc filtra oznaczonego niebieskim kolorem moesz zawzi liczb urzdze pojawiajcych si na licie. Dla przykadu, list mona zawzi do maszyn nalecych tylko do jednej grupy produktowej.\n\nDomylnie moesz zobaczy jedynie urzdzenia, ktre podlegaj kontroli powrotnej lub s w jej trakcie. Jeli chcesz zobaczy zakoczone kontrole musisz wybra filtr "Zakoczone".` }, { language: `nb`, value: `Denne siden viser alle ventende og nylig fullfrte servicer og/eller reparasjoner for hvert depot.\n\nHvert listeelement viser flgende informasjon:\n\n-Renta ID\n\n-Depotnummer\n\n-Produktnavn\n\n-Dato nr enheten ble satt i service/reparasjon\n\nVed  klikke p et element i listen kan du se siden til den aktuelle enheten.\n\nVed  bruke det bl filterikonet kan du begrense elementene som vises p listen. For eksempel kan du bare se alle enheter fra n produktgruppe.\n\nSom standard kan du bare se ditt eget depots enheter, men hvis du har rettigheter til  se andre depots enheter, kan du se mer enn ett depotnummer i listen.\n\nI listen over betjente enheter kan du se de 10 sist fullfrte enhetene og fullfringsdatoen.` }, { language: `en`, value: `This page shows all pending and recently completed services and/or repairs for each depot.\n\nEach list item shows the following information:\n\n- Renta ID\n\n- Depot number\n\n- Device name\n\n- Date when the device was placed in service/repair\n\n- Group name\n\n- Status of service/repair\n      \n- Fault comment\n\n \n\nRange of the list items you can manage using the icon with three white horizon lines. \n\n \n\nThe S&R list also has a color code:\n\n<b>orange</b> - waiting for the service/repair\n\n<b>green</b> - S&R is in progress\n\n<b>blue</b> - completed \n      \n\nUsing the blue filter icon, you can narrow down the items appearing on the list. For example, you can only view all devices from one product group. By default, you can see only devices that waiting for the Service/Repair or In progress. If you want to see the Completed services you can choose Completed in the Service status field.\n\nBy default, you can only view your own depots devices but if you have rights to view other depots devices, you may see more than one depot number in the list.\n\nBy clicking an item in the list, you can view the page of the device in question.` }, { language: `da`, value: `Denne side viser alle ventende og nyligt afsluttede Inspektioner og/eller reparationer for hver afdeling.\n\nHver liste "element" viser flgende oplysninger:\n\n-Renta ID\n\n-Afdeling\n\n-Individ navn\n\n-Dato, hvor Individ\n\n- Dato, hvor individ blev sat til service/repareret\n\n- Gruppens navn\n\n- Status p service/reparation\n      \n- Fejl kommentar\n\nOmrde af list elementerne, du kan administrere ved hjlp af ikonet med tre hvide horisontlinjer. \n\nS&R-listen har ogs en farvekode:\n\n<b>Orange</b> - venter p service/reparation\n\n<b>grn</b> - S&R er i gang\n\n<b>bl</b> - afsluttet \n\n\nVed hjlp af det bl filterikon kan du indsnvre de individer, der vises p listen. Du kan f.eks. kun se alle individer fra n produktgruppe.\n\nSom standard kan du kun se dine egne Som standard kan du kun se individer, der venter p service/reparation eller i gang.\nHvis du vil se "Afsluttede service/inspektioner", kan du vlge "Afsluttet" i feltet Servicestatus.\n\nSom standard kan du kun se dit egen afdelings individer, men hvis du har rettigheder til at se andre afdelingers individer, kan du muligvis se mere end t afdelingsnummer p listen.\n\nVed at klikke p et element p listen kan du se siden for den pgldende enhed.` },);
