        this.set(this.takePicturesPageInfoContentLanguageItemName, { language: `fi`, value: `Tll sivulla voit tehd havaintoja tai huomioita laitteesta ja sen kunnosta milloin tahansa. Tehdyt havainnot ja huomiot tallennetaan koneen historiaan ja lydt ne koneen palautustarkastushistorian yhteydest.\n##\n<b>Selaa- ja Kamera-painikkeet</b>\n##\n##\n##\n\nNill painikkeilla voit list tai ottaa valokuvan tekemstsi havainnosta. Selaa-painike avaa mobiililaitteen tai tietokoneen tiedostot, josta voit list valokuvia. Kamera-painike avaa mobiililaitteen kameran valokuvan ottamista varten. Voit tarvittaessa list tai ottaa useampia valokuvia.\n##\n<b>Kuvanksittelypainikkeet</b>\n##\nJos havaintosi sislt jo kuvia, voi valita mink tahansa listyist kuvista ja ksitell sit suoraan Toolsissa. Valittaessa kuva esiin tulee seuraavat tykalut:\n##\n<small>Kuvan kierto</small>\n\n##\nJos kuva on vrin pin, voit kiert kuvaa vasemmalle tai oikealle nill nppimill.\n\n##\n<small>Kuvan muokkaus</small>\n\n##\nJos haluat rajata kuvasta nkyviin vain tietyn osan, voit tehd sen tll nppimell. Painettaessa ruutuun aukeaa rajaustykalu, jonka rajoja raahaamalla voit rajata kuvaan vain haluamasi kohdan. Samalla voit mys kiert kuvaa vasemmalle ja oikealle.\nMuistathan tallentaa muokkauksesi!\n##\n<small>Esikatsele</small>\n\n##\nTll painikkeella voit nytt valitsemasi kuvan ruudulla suurempana.\n##\n<small>Poista</small>\n\n##\nTm painike poistaa valitsemasi kuvan. Poistettua kuvaa ei voi en palauttaa, vaan kuva tulee list laitteesta tai ottaa kameralla uudelleen.\n##\n<b>Kommentti</b>\n##\nThn kenttn voit sytt haluamasi kommentit koskien laitteesta tekemsi havaintoa tai huomiota. Kuvan lisksi kommentti on aina suositeltavaa kirjoittaa, jotta tehty havainto tai huomio olisi mahdollisimman selke.\n##\n<b>Tallenna-painike</b>\n\n##\nTll painikkeella voit tallentaa tekemsi havainnon tai huomion. Painike on aktiivinen vasta, kun vhintn yksi valokuva on sytetty lomakkeelle.\n##\n<small>Takaisin</small>\n\n##\nTm painike vie tallentamatta takaisin edelliselle sivulle. ` }, { language: `sv`, value: `TaBilderSida.Info.Innehll` }, { language: `pl`, value: `StronaRobieniaZdj.Informacj.Zawarto` }, { language: `nb`, value: `` }, { language: `en`, value: `` }, { language: `da`, value: `` },);
