        this.set(this.returnInspectionContinueErrorOldInpsectionLanguageItemName, { language: `fi`, value: `Valitettavasti et voi jatkaa palautustarkastusta, joka on aloitettu ohjelman vanhassa versiossa. Peruuta tarkastus ja aloita alusta.` }, { language: `sv`, value: `Tyvrr r det inte mjligt att fortstta inspektionen, som pbrjades i den gamla versionen av inspektionen. Avbryt inspektionen och starta den igen.` }, { language: `pl`, value: `Kontynuacja inspekcji rozpocztej w starszej wersji jest niemoliwa. Anuluj inspekcj i rozpocznij j od nowa.` }, { language: `nb`, value: `Dessverre er det ikke mulig  fortsette kontrollen, startet i den gamle versjonen av Returkontrollen. Vennligst avbryt kontrollen og start den p nytt.` }, { language: `en`, value: `Unfortunately, continuing the inspection, started in the old version of Return Inspection is not possible. Please, cancel the inspection and start it.` }, { language: `da`, value: `Desvrre er det ikke muligt at fortstte inspektionen, der blev startet i den gamle version af Return Inspektion. Annuller venligst inspektionen og start den.` },);
        this.set(this.returnedDevicesPageInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Palautustarkastusluettelo` }, { language: `sv`, value: `Sidanvisningar: Returbesiktningslista` }, { language: `pl`, value: `Instrukcja strony: Lista kontroli powrotnych` }, { language: `nb`, value: `Sideveiledning: Returkontrollliste` }, { language: `en`, value: `Page instructions: Return inspection list` }, { language: `da`, value: `Sidevejledning: Returinspektionsliste` },);
        this.set(this.returnedDevicesPageInfoContentLanguageItemName, { language: `fi`, value: `Tll sivulla nkyy jokaisen varaston kaikki vireill olevat ja skettin suoritetut palautustarkastukset.\n\n\n\nJokaisella rivill nytetn seuraavat tiedot:\n\n\n\n-Renta-numero\n\n\n\n-Toimipisteen numero\n\n\n\n-Laitteen nimi\n\n\n\n-Tarkastuksen tila\n\n\n\n-Tarkastusta parhaillaan tekev kyttjtunnus\n\n\n\n-Palautuspiv, jos laite odottaa palautustarkastusta, tai viimeinen tarkastuspiv, jos laite muussa tilassa\n\n\n\nPalautustarkastusluettelo on mys vrikoodattu:\n\n\n\n<b>Oranssi</b> - Odottaa palautustarkastusta\n\n\n\n<b>Vihre</b> - Palautustarkastus on kynniss\n\n\n\n<b>Keltainen</b> (toistaiseksi kytss vain Ruotsissa) - Tarkastus on osittain valmis: yksi kyttj on suorittanut osan tarkastuksesta, tallentanut oman osuutensa ja tarkastus on valmis jatkettavaksi toisen kyttjn toimesta.\n\n\n\n<b>Punainen</b> (huutomerkill) - Priorisoitu tarkastus\n\n\n\n<b>Sininen</b> - Palautustarkastus suoritettu\n\n\n\nJos tarkastus sislt tankkaus- tai puhdistusvaiheita, net luettelokohdassa asiaankuuluvat kuvakkeet.\n\n\n\nNapsauttamalla listassa olevaa kohdetta pset tarkastelemaan kyseisen laitteen sivua, jolta pset edelleen aloittamaan palautustarkastuksen. \n\n\n\nKlikkaamalla polttoaine- tai puhdistuskuvaketta tuoteluettelossa, sinut ohjataan suoraan asiaankuuluvaan palautustarkastuksen vaiheeseen.\n\n\n\nSivun ylosan sinisen suodatinkuvakkeen avulla voit rajata luettelossa nkyvi kohteita. Voit esimerkiksi tarkastella vain yhden tuoteryhmn laitteita.\nOletusarvoisesti net vain laitteet, jotka odottavat palautustarkastusta tai ovat palautustarkastettavana. Jos haluat nhd mys tilassa Valmis olevat laitteet, voit valita Palautustarkastuksen tila -kentst "Valmis".\n\n\n\nOletuksena voit tarkastella vain oman toimipisteesi laitteita, mutta jos sinulle on mynnetty lisoikeuksia tarkastella mys muiden toimipisteiden laitteita, saatat nhd luettelossa useamman kuin yhden toimipistenumeron.` }, { language: `sv`, value: `Den hr sidan visar alla pgende och nyligen genomfrda returinspektioner fr varje dep.\n\n\n\nVarje listobjekt visar fljande information:\n\n\n\n-Renta ID\n\n\n\n-Depnummer\n\n\n\n-Enhetsnamn\n\n\n\n-Status fr inspektionen\n\n\n\n-Anvndarnamn som arbetar med besiktningen\n\n\n\n-Returdatum (eller senaste inspektionsdatum)\n\n\n\nReturbesiktningslistan har ven en frgkod:\n\n\n\n   \n\n\n\n<b>orange</b> - vntar p besiktningen\n\n\n\n<b>grn</b> - inspektion pgr\n\n\n\n<b>gul</b> - inspektionen r delvis klar: en anvndare har slutfrt en del av inspektionen, sparat den och inspektionen r redo att fortstta med en annan anvndare (endast tillgnglig fr Tools SE fr nrvarande)\n\n\n\n<b>rd</b> (med utropstecken) - hgprioriterad inspektion\n\n\n\n<b>bl </b> genomfrd besiktning\n\n\n\nOm inspektionen inkluderar tanknings- eller rengringssteg kommer du att se relevanta ikoner i listobjektet.\n\n\n\nGenom att klicka p ett objekt i listan kan du se sidan fr enheten i frga. Genom att klicka p brnsle- eller rengringsikonen i objektlistan kommer du att vidarebefordras till det relevanta steget.\n\n\n\nMed den bl filterikonen kan du begrnsa objekten som visas p listan. Du kan till exempel bara se alla enheter frn en produktgrupp.\nSom standard kan du bara se enheter som vntar p returbesiktningen eller under inspektionen. Om du vill se den slutfrda besiktningen kan du vlja "Slutfrd" i fltet Returbesiktningsstatus.\n\n\n\nSom standard kan du bara se din egen deps enheter men om du har rtt att se andra deps enheter kan du se mer n ett depnummer i listan.` }, { language: `pl`, value: `Ta strona pokazuje wszystkie trwajce i ostatnio zakoczone kontrole powrotne dla kadego oddziau.\n\nKady element na licie wskazuje informacje:\n\n-Kod Renta\n\n-Numer oddziau\n\n-Nazw urzdzenia\n\n-Status kontroli\n\n-Nazwa uytkownika, ktry dokonuje kontroli\n\n-Dat zwrotu (lub dat ostatniej kontroli)\n\nLista kontroli powrotnych posiada rwnie swj kolorystyczny kod:\n\n<b>pomaraczowy</b> - czeka na kontrol\n\n<b>zielony</b> - trwajca kontrola\n\n<b>ty</b> - kontrola czciowo zakoczona\n\n<b>czerwony</b> (z wykrzyknikiem) - kontrola o wysokim priorytecie\n\n<b>niebieski</b> - kontrola zakoczona\n\nJeli z kontrol s powizane koszty czyszczenia lub tankowania, odpowiednie ikony pojawi si na licie. \n\nPoprzez kliknicie w urzdzenie na licie, mona dosta si do strony urzdzenia. Po naciniciu ikony tankowania lub czyszczenia zostaniesz przeniesiony do odpowiedniego moduu aplikacji.\n\n\nUywajc filtra oznaczonego niebieskim kolorem moesz zawzi liczb urzdze pojawiajcych si na licie. Dla przykadu, list mona zawzi do maszyn nalecych tylko do jednej grupy produktowej.\nDomylnie moesz zobaczy jedynie urzdzenia, ktre podlegaj kontroli powrotnej lub s w jej trakcie. Jeli chcesz zobaczy zakoczone kontrole musisz wybra filtr "Zakoczone".\n\nDomylnie moesz zobaczy urzdzenia tylko ze swojego oddziau. Jeli jeste uprawniony do ogldania urzdze z innych oddziaw, pojawi si na tej licie.` }, { language: `nb`, value: `Denne siden viser alle ventende og nylig gjennomfrte returinspeksjoner for hvert depot.\n\n\n\nHvert listeelement viser flgende informasjon:\n\n\n\n-Leie ID\n\n\n\n-Depotnummer\n\n\n\n-Enhets navn\n\n\n\n- Status for inspeksjonen\n\n\n\n-Brukernavn som jobber med kontrollen\n\n\n\n-Returdato (eller siste inspeksjonsdato)\n\n\n\nReturinspeksjonslisten har ogs en fargekode:\n\n\n\n<b>oransje</b> - venter p inspeksjonen\n\n\n\n<b>grnn</b> - inspeksjon pgr\n\n\n\n<b>gul</b> - inseksjon er delvis fullfrt: n bruker har fullfrt en del av inspeksjonen, lagret den og inspeksjonen er klar til  fortsette med en annen bruker (bare tilgjengelig for Tools SE forelpig)\n\n\n\n<b>rd</b> (med utropstegn) - hyprioritet inspeksjon\n\n\n\n<b>bl</b> - fullfrt inspeksjon\n\n\n\nHvis inspeksjonen inkluderer tanking eller rengjringstrinn, vil du se relevante ikoner i listeelementet. \n\n\n\nVed  klikke p et element i listen kan du se siden til den aktuelle enheten. Ved  klikke p drivstoff- eller rengjringsikonet i varelisten, blir du videresendt til det aktuelle trinnet.\n\n\n\n\nVed  bruke det bl filterikonet kan du begrense elementene som vises p listen. For eksempel kan du bare se alle enheter fra n produktgruppe.\nSom standard kan du bare se enheter som venter p returinspeksjonen eller under inspeksjonen. Hvis du vil se Fullfrt inspeksjon, kan du velge "Fullfrt" i feltet Returinspeksjonsstatus.\n\n\n\nSom standard kan du bare se ditt eget depots enheter, men hvis du har rett til  se andre depots enheter, kan du se mer enn ett depotnummer i listen.` }, { language: `en`, value: `This page shows all pending and recently completed return inspections for each depot.\n\n\n\nEach list item shows the following information:\n\n\n\n-Renta ID\n\n\n\n-Depot number\n\n\n\n-Device name\n\n\n\n-Status of the inspection \n\n\n\n-User name who is working with the inspection\n\n\n\n-Return date (or last inspection date)\n\n\n\nThe return inspection list also has a color code: \n\n\n\n<b>orange</b> - waiting for the inspection \n\n\n\n<b>green</b> - inspection is in progress\n\n\n\n<b>yellow</b> - insection is partly completed: one user has completed part of the inspection, saved it and the inspection is ready to be continued with another user (available for Tools SE only for now)\n\n\n\n<b>red</b> (with exclamation mark) - high-priority inspection\n\n\n\n<b>blue</b> - completed inspection \n\n\n\nIf the inspection includes fueling or cleaning steps, you will see relevant icons in the list item. \n\n\n\nBy clicking an item in the list, you can view the page of the device in question. By clicking the fuel or cleaning icon in the item list, you will be forwarded to the relevant step. \n\n\n\n\nUsing the blue filter icon, you can narrow down the items appearing on the list. For example, you can only view all devices from one product group.\nBy default, you can see only devices that waiting for the Return Inspection or under the Inspection. If you want to see the Completed inspection you can choose Completed in the Return inspection status field. \n\n\n\nBy default, you can only view your own depots devices but if you have the right to view other depots devices, you may see more than one depot number in the list.` }, { language: `da`, value: `Denne side viser alle afventende og nyligt afsluttede returinspektioner for hver afdeling.\n\nHvert liste individ viser flgende oplysninger:\n\n-Renta ID\n\n-Afdelings nummer\n\n-Individ navn\n\n-Status for inspektionen\n\n-Brugernavn, der arbejder med inspektionen\n\n-Returdato (eller sidste inspektionsdato)\n\nReturinspektionslisten har ogs en farvekode:\n\n<b>orange</b> - venter p inspektionen\n\n<b>grn</b> - inspektion er i gang\n\n\n<b>gul</b> - inspektion er delvist afsluttet: en bruger har gennemfrt en del af inspektionen, gemt den, og inspektionen er klar til at blive fortsat med en anden bruger (kun tilgngelig for Tools SE indtil videre)\nnn\n<b>rd</b> (med udrbstegn) - inspektion med hj prioritet\nnn\n<b>bl</b> - afsluttet inspektion \nnn\nHvis inspektionen omfatter brndstofpfyldning eller rengringstrin, vil du se relevante ikoner i listeelementet. \n\nVed at klikke p et element p listen kan du se siden for det pgldende individ. Ved at klikke p brndstof- eller rengringsikonet p varelisten videresendes du til det relevante trin. \n\nVed hjlp af det bl filterikon kan du indsnvre de elementer, der vises p listen. Du kan f.eks. kun se alle individer fra n produktgruppe.\n\n\nSom standard kan du kun se individer, der venter p returinspektionen eller under inspektionen. Hvis du vil se Fuldfrt inspektion, kan du vlge "Fuldfrt" i feltet Status for returinspektion. \n\nSom standard kan du kun se din egen afdelings individer, men hvis du har ret til at se andre afdelingers individer, kan du muligvis se mere end t afdelingsnummer p listen.\n` },);
