        this.set(this.genericDeletePermanentlyConfirmLanguageItemName, { language: `fi`, value: `Tm poistaa kohteen pysyvsti JA kaikki siihen liittyvt kohteet tietokannasta. Tietojen vienti ennen tt toimintoa on suositeltavaa. Ilman tietojen vienti niit ei voi palauttaa helposti. \n Haluatko jatkaa?` }, { language: `sv`, value: `Detta kommer att radera objektet permanent OCH alla dess relaterade objekt frn databasen. Det r rekommenderat att exportera data innan denna tgrd. Utan dataexport kan de inte terstllas enkelt. \n Fortstta?` }, { language: `pl`, value: `To spowoduje trwae usunicie pozycji oraz wszystkich powizanych z ni pozycji z bazy danych. Zaleca si wyeksportowanie danych przed wykonaniem tej akcji. Bez wyeksportowania danych nie mona ich odzyska. \n Kontynuowa?` }, { language: `nb`, value: `Dette vil slette elementet permanent OG alle dets tilknyttede elementer fra databasen. Det anbefales  eksportere data fr denne handlingen. Uten eksport av data kan de ikke gjenopprettes enkelt. \n Fortsette?` }, { language: `en`, value: `This will permanently delete the item AND all it's related items from database. Exporting data before this action is suggested. Without exporting data, these cannot be recovered easily. \n Proceed?` }, { language: `da`, value: `Dette sletter permanent elementet OG alle dets relaterede elementer fra databasen. Det foresls, at der eksporteres data fr denne handling. Uden eksport af data kan disse ikke gendannes let. \n Fortstte?` },);
